import React from 'react';
import styled from 'styled-components'

const Center = styled.div`
  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

export default (props) => (
	<Center>{props.children}</Center>
);
